  input: '"TEXT","F3XA","C00167320","Q1.  The Committee inadvertently failed to disclose
    memo text for memo entries on Line 12 of Schedule A.  Said text is now disclosed
    along with additional memo items which Committee inadvertently failed to disclose
    and memo activity now corresponds with itemized transactions. Q2.  The Committee
    inadvertently failed to disclose its debt to this credit card vendor.  Said debt
