    that these activities do not meet the definition of Federal Election Activity
    as these expenditures were for costs incurred in the building of our voter file,
    not for voter drive expenses and therefore payment for these activities were appropriately
    disclosed on line 21 (a).  Q5. Q2. Due to a software glitch the Committee inadvertently
    disclosed FEA payroll, FEA health insurance and FEA payroll taxes on line 21(b)
    and also disclosed non FEA payroll on 21(b) but denoted it as FEA payroll.  This
    technical error has been fixed and FEA payroll, FEA health insurance and FEA payroll
